    the following: 1) No expenditures disclosed on Schedule B, Line 21b were made
    on behalf of any specifically identified federal candidate.  All expenditures
    made on behalf of a specifically identified federal candidate have been disclosed
    on Schedule B, Line 23. 11 CFR 104.3 (b) and 106.1 2) No expenditures disclosed
    on Schedule B, Line 21b were made for public communications (as defined by 11
    CFR 100.26) or voter drive activity (under 11 CFR 106.6(b)(2)(i)) containing express
    advocacy as defined under 11 CFR 100.22 and thus did not constitute in-kind contributions
    or independent expenditures. 3) The committee has reviewed all travel and subsistence
    expenditures, and reviewed the reporting requirements outlined at 11 CFR 104.9
    and in the instructions for Schedule B. There is no further itemization required
    under any Commission regulation for these expenditures."
